import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';

import React from 'react'
import Home from './pages/Home';
import Users from './pages/Users';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route  path ='/' element={<Home/>}/>
        <Route  path ='/user' element={<Users/>}/>
      </Routes>
    </BrowserRouter>
  )
}

export default App
